  const [role, setRole] = useState(probs.isAdmin);
  useEffect(() => {
    setRole(probs.isAdmin);
  }, [probs.isAdmin]);
  console.log(probs.isAdmin);
  if (role === true) {
    console.log("1");
    return probs.children;
  } else {
    console.log("2");
    return <Navigate to="/" />;
  }
};
export default AdminRoutes;
